// Base Parameter Setting (MDH Based)
const int nb = 52 ;
double Beta[nb] = { 0.0 } ;
double r1 = 0.1795;
double r2 = 0;
double r3 = 0;
double r4 = 0.432;
double r6 = 0.1613;
double d3 = 0.6355;
double g = -9.81 ; 

void RobotModel_Beta( char *path )
{

	FILE *BetaFile = fopen( path , "r" ) ;

	for( int i = 0 ; i < nb ; i++ )
	{

		fscanf( BetaFile , "%lf", &Beta[i] ) ;

	}

	fclose( BetaFile ) ;

}

bool ReadFullDynamicParameter( const std::string& name )
{
	if (FILE *file = fopen(name.c_str(), "r")) {

		for( int i = 0 ; i < nb ; i++ )
			fscanf( file , "%lf", &Beta[i] ) ;
        return true;

    } 
	else {
        return false;
    }   
}

