void GetCoriolisTorque( double Pos[AXIS], double Vel[AXIS], double (&CoriolisTorque)[AXIS] ){
	
	// Parameter definition
	double v[AXIS] = { 0.0 }; 
	for( int ijoint = 0 ; ijoint < AXIS ; ijoint ++ ){
		v[ijoint] = Vel[ijoint];
	}
	
	// Get InertiaMatrix
	Matrix<double, AXIS, AXIS> coriolisMatrix;
	GetCoriolisMatrix(Pos, Vel, coriolisMatrix);
	
	// Compute inertia torque
	for(int ijoint = 0; ijoint < AXIS ; ijoint++ ){
		
		// clean origin torque first
		CoriolisTorque[ijoint] = 0;
		
		for(int jjoint = 0; jjoint < AXIS ; jjoint++ ){
			CoriolisTorque[ijoint] += coriolisMatrix(ijoint, jjoint) * v[jjoint];
		}
	}
}

//================ Full Model of FrictionTorq, IV identification method ================

void GetFrictionTorque( double Vel[AXIS] , double (&FrictionTorque)[AXIS]){
	
	// Parameter definition
	double v[AXIS] 	   = { 0.0 };
	double signV[AXIS] = { 0.0 } ;
	double alpha[AXIS] = { 200.0, 200.0, 200.0, 200.0, 200.0, 200.0 } ;
	
	for( int ijoint = 0 ; ijoint < AXIS ; ijoint ++ ){
		v[ijoint] = Vel[ijoint];
		//signV[ijoint] = Toolbox_sign( v[ijoint] , 0.0 ) ;
		signV[ijoint] = tanh( alpha[ijoint] * v[ijoint] );
	}
		
	// FrictionTorq
	FrictionTorque[0] =  Beta[2]*v[0]  + Beta[1]*signV[0]  ;	
	FrictionTorque[1] =  Beta[11]*v[1] + Beta[10]*signV[1] ;	
	FrictionTorque[2] =  Beta[21]*v[2] + Beta[20]*signV[2] ;	
	FrictionTorque[3] =  Beta[31]*v[3] + Beta[30]*signV[3] ; 	
	FrictionTorque[4] =  Beta[41]*v[4] + Beta[40]*signV[4] ; 	
	FrictionTorque[5] =  Beta[51]*v[5] + Beta[50]*signV[5] ;
}


